import React from 'react';
import { Route } from 'react-router-dom';
import Form from '../forms/Form.js';

export default function signup(obj) {
    return (
        <div>
            <Route exact path="/signup" component={() =>
                <>
                    Sign up page
                    <Form inputs={["first_name", "last_name", "email", "password"]} text={["First name", "Last Name", "Email", "Password"]} output={"Sign up"} onSend={obj.handleSendSignupForm} />
                </>
            } />
        </div>
    )
}
